import React, { Component } from "react";
import Axios from "axios";

class Maskcall extends Component {
    constructor() {
        super();
        this.state = {
            div4 : 1
        }
    }
    componentDidUpdate() {
        this.sibal();
    }
    async sibal() {
        let a = this.props.mylat;
        let b = this.props.mylng;
        const result = await Axios.get('https://8oi9s0nnth.apigw.ntruss.com/corona19-masks/v1/storesByGeo/json', {
            params : {
                lat : a,
                lng : b,
                m : 1000
            }
        })
        if (result.data.stores>0) {
            console.log(result);
            const datas = result.data.stores;
            console.log(datas);
        }
        else { console.log(result); console.log('API 서버가 지연되고 있습니다.') }
        
    }
    render() {
        return (
            <>
            {this.state.div4}
            </>
        )
    }


}


export default Maskcall;
